import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';

const MemberDashboard = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);

  useEffect(() => {
    // Get user data from localStorage
    const userData = localStorage.getItem('user');
    if (!userData) {
      navigate('/login');
      return;
    }

    const parsedUser = JSON.parse(userData);
    if (parsedUser.userType !== 'member') {
      navigate('/login');
      return;
    }

    setUser(parsedUser);
  }, [navigate]);

  if (!user) return null;

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Welcome, {user.name}!</h1>
        <p>Member Dashboard</p>
      </div>

      <div className="dashboard-content">
        <div className="dashboard-card">
          <h3>My Orders</h3>
          <p>View and manage your tiffin orders</p>
          <button className="dashboard-button">View Orders</button>
        </div>

        <div className="dashboard-card">
          <h3>Meal Plans</h3>
          <p>Browse available meal plans</p>
          <button className="dashboard-button">View Plans</button>
        </div>

        <div className="dashboard-card">
          <h3>Profile</h3>
          <p>Update your profile information</p>
          <button className="dashboard-button">Edit Profile</button>
        </div>

        <div className="dashboard-card">
          <h3>Support</h3>
          <p>Get help with your orders</p>
          <button className="dashboard-button">Contact Support</button>
        </div>
      </div>
    </div>
  );
};

export default MemberDashboard;
